	(161, 39, 'MESSAGE FROM ROTARY INTERNATIONAL PRESIDENT', 'GARY C.K. HUANG', 'message-from-rotary-international-president', '<p>Rotary is an organization that has something for everyone. All over the world, in cities and towns, for well over a century, Rotarians have come together to serve. And in the years since Rotary was founded, countless Rotarians and others have discovered the joys of Rotary service, through Rotaract, Interact, Rotary Community Corps, Youth Exchange, and many other programs.</p><p>All of us are part of the family of Rotary. And we have all gained so much from our Rotaryservice. We\'ve made friends, helped our communities, and made the world a better, safer, and healthier place. We\'ve become part of a truly international network of volunteers, and we\'ve learned how much we can achieve when we put our differences aside and work together.</p><p>Many of the ideas and values that we cherish in Rotary are not unique to Rotary. Perhaps the reason Rotary resonates so deeply with me is that I find many traditional Chinese values reflected in Rotary: values of service and responsibility, of respect for family and for others. It is not surprising, then, that the ideas of Confucius so often guide me in my Rotary service. To me, Confucius was the original Rotarian. More than two thousand years before Paul Harris was born, he said: To put the world in order, we must first put the nation in order; to put the nation in order, we must put the family in order; to put the family in order, we must first set our hearts right. In Rotary, we set our hearts right by putting Service Above Self. And we recognize that in order to be ambitious in our service, we must first care for our own organization and expand our family of Rotary.</p><p>In 2014-15, I will ask all of you to Light Up Rotary — by sharing our service, strengthening our clubs, and letting our light shine in our communities. In this Rotary year, we will Light Up Rotary by reaching our goal of 1.3 million Rotarians, bringing in new members while working to keep the members we have. To do this, we\'ll need to approach membership in new ways, and try new ideas. Hold a Rotary Day to give your community a chance to learn more about Rotary. Remember that Rotary is a family and is for the family: Encourage your spouse and other family members to consider joining, and reach out to Youth Exchange and Foundation alumni. Focus on your own club, and look realistically at why members stay, and why they leave. What can you do to make being a Rotarian an appealing and attractive opportunity for busy professionals and those with young families</p><p>We will also Light Up Rotary — and make history — by eradicating polio. Polio eradication within the next few years is absolutely realistic — if we keep up our momentum. So tell your friends, associates, and elected officials how critical it is that we End Polio Now. Donate to the PolioPlus Fund and encourage others to do so as well. By meeting the newest challenge issued by the Bill &amp; Melinda Gates Foundation, we can make our money work three times as hard. Be an active part of the greatest public-private health partnership in the history of the world, and share in the pride when the job is finished. In 2014-15, as we strengthen our clubs and Light Up Rotary in more than 34,000 communities, our commitment and our service will light up the world.?</p>', 1, 1, 'rtn-gary.jpg', 'RI President', '2014-15', NULL, NULL, NULL, NULL, 25, NULL, NULL, NULL, NULL, NULL, NULL, '2015-08-26 19:48:16', NULL),
	(162, 39, 'MESSAGE FROM DISTRICT GOVERNER', 'RABINDRA PIYA', 'message-from-district-governer', '<h5>Dear President Rtn. Rama Kanta Baral</h5><h5><p>Congratulations on your assuming the office of President of your club for the year 2014-15. I also congratulate your dedicated team of club officers for a very successful year ahead</p><p>Light up Rotary is the annual theme give by Rotary International President Gary C.K. Huang. who has challenged us to take action and make Rotary strong. One of the many ways to Light Up Rotary is to plan and host Rotary Day as an event to make new friends, exchange ideas, and take action to improve their local community and the world. Let us do it earnestly by highlighting the work of ordinary Rotary members doing extraordinary humanitarian work. Let us take this challenge together and Light Up Rotary.</p><p>All we asay and do must satisfy our own conscience as a Rotary Leade whether it benefits our clubs and our communities by adding some value is someone\'s life, which would ultimately satisfy our instinct of doing something good in the world. By satisfying our instinct, we can get joy at work and start enjoying Rotary.</p><p>Enjoy Rotary, by all means.</p><p>Yours-In-Rotary?</p></h5>', 1, 2, 'rtn-rabindra.jpg', 'District Governor', '2013-14', NULL, NULL, NULL, NULL, 25, NULL, NULL, NULL, NULL, NULL, NULL, '2015-08-26 19:49:38', NULL),
	(163, 39, 'MESSAGE FROM PRESIDENT', 'RAMA KANTA BARAL', 'message-from-president', '<h5>Dear Fellow Rotarians,</h5><h5><p>While assuming the office of the President of our prestigious club for 2014/15, at the very out set, I would like to extend my deep sense of gratitude to all my fellow rotarians for giving me this opportunity to act whole heartedly in giving direction and drive to the plans, aims and objectives of the club.</p><p>Working hand in hand with members of the club associated with different professions and business sectors, I feel somewhat elated to think, though tough, I will be working effectively to forward the humanatarian service in the true spirit of our commitment "Service above self". I feel pride to recount here a host of noble activities successfully conducted by this club since its inception in many areas of human concern such as education, health, poverty reduction, peace and family values and so on.</p><p>In the changing times all of us need to make more and more valuable contribution in the priority areas of our service for the society. Side by side, I feel, we should try to explore new vistas of service sectors as far as practicable.</p><p>In maintaining and developing international relation, activating highly reliable partnership with different sister clubs and in many service areas of noble human interest, our club has been sucessful to produce a host of landmarks. It is a matter of pride for us all. In these and other areas, I will be endevouring my level best to maintain and enhance the glorious strides of this club. No doubt, much has been done for the benefit of Nepalese people from the future vision program of the Rotary Foundation and it is heartening to mention-all of us, rotarians are moving ahead in genuine team spirit. Even so, we need to go on structuring the slots of time to make the range of our mission higher and wider.</p><p>Before giving a close to my words, I would also like to draw the attention of all, specifically the rotarians to keep in mind the superbly remarkable theme, \'LIGHT UP ROTARY\', forwarded by the President of the Rotary International for 2014/15, Mr, Gary C.K. Huang. Introducing the theme, \'LIGHT UP ROTARY\', respected Gary has given a new concept, \'Rotary Days\' which, I believe, will assist us more in our existing membership drive, strengthening our club\'s relationships with local institutions and community members as well as in improving the image of our club not only in local and national level but in international level as well.</p><p>Finally, I would like to invite all the fellow rotarians and people in general to come forward with open mind to share their noble ideas and spirit to widen the horizon of the service of this club for creating better situations of life in this part of the world and of course, keeping our minds and eyes open for the well being of the people in the international level too.</p><p>With bountiful thanks to you all?</p></h5>', 1, 1, 'rtn-rama.jpg', 'District Governor', '2014 - 15', NULL, NULL, NULL, NULL, 25, NULL, NULL, NULL, NULL, NULL, NULL, '2015-08-26 19:50:36', NULL),
