	(192, 4, 'club profile', NULL, 'club-profile', '<p>Nepal is a landlocked country situated in south Asia. Its area is 147000 of sq. km. and Population about 29 million. Pokhara is a beautiful tourism city of Nepal. It is situated at the middle west part of Nepal. It is a city surrounded by beautiful hill and mountains full of Natural beauty with Phewa Lake, Seti River and the Annapurna Range. About 4 hundred thousand inhabit this beautiful peace of paradise.</p>\r\n<p><br />The Rotary Club of Pokhara Fishtail was established in 2003 under the presidency of Rtn. Dr. Sunu Dulal as the chartered President. It is the 3rd Club of Pokhara City. It was Sponsored by Rotary club of Pokhara with the initiation of GSR Rtn. Sundar Kumar Shrestha, past president of the club . The club was chartered on 22nd October 2003 under the RI District 3290 (until 30 Jun 2008). There were 46 members at the time of charter.</p>\r\n<h2>President of the club</h2>\r\n<p>Rtn. Dr. Sunu Dulal - MPHF 2003/04<br />Rtn. Arjun Thapa PHF 2004/05<br />Rtn. Capt.Bhuwansing Gurung PHF 2005/06<br />Rtn. L.B. Baniya PHF 2006/07<br />Rtn. Dhruba K.C 2007/08<br />Rtn Binod Koirala PHF 2008/09<br />Rtn. Jayandra Gauchan PHF 2009/10<br />Rtn. Er. Suresh Pd. Shrestha PHF 2010/11<br />Rtn. Bishnu Hari Timilsina MPHF 2011/12<br />Rtn Raju Paudel PHF 2012/13<br />Rtn Narayan Pd. Sharma 2013/14<br />Rtn Ramakanta Baral 2014/15</p>\r\n<p>&nbsp;</p>\r\n<h2>Members of the Club as April 2012 with MPHF and PHF</h2>\r\n<ol>\r\n<li>\r\n<p>PP Rtn. Dr. Sunu Dulal MPHF 6024267</p>\r\n</li>\r\n<li>\r\n<p>PP Rtn. Arjun Thapa PHF 6025207</p>\r\n</li>\r\n<li>\r\n<p>PP Rtn Bhuwansing Gurung PHF 6025176</p>\r\n</li>\r\n<li>\r\n<p>PP Rtn. Binod Koirala PHF 6024268</p>\r\n</li>\r\n<li>\r\n<p>PP Rtn. Jayendra Gauchan PHF 6025182</p>\r\n</li>\r\n<li>\r\n<p>IPP. Rtn. Er.Suresh Pd. Shrestha PHF 6025192</p>\r\n</li>\r\n<li>\r\n<p>President Rtn. Bishnu Hari Timilsina MPHF 6025173</p>\r\n</li>\r\n<li>\r\n<p>Rtn. Tej Bahadur Gurung 6025213</