	(193, 46, 'Rotary Community Corps, dhunga sanghu, pokhara', NULL, 'rotary-community-corps-dhunga-sanghu-pokhara', '<p>A Rotary Community Corps (RCC) is a team of non-Rotarian men and women who are committed to their community\'s long-term development and selfsufficiency. An RCC is sponsored by a Rotary club and, like Rotaract and Interact clubs, is one of Rotary\'s partners in service. The main principle of the program is to enable RCC members to personally address and solve problems in the area where they work or live.</p>\r\n<h4>Consider what an RCC can do in your community:</h4>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Establish a literacy center or tutor group at a local school or library</li>\r\n<li>Set up a clinic for people who cannot afford regular health and dental care</li>\r\n<li>Create a vocational training program to help workers obtain valuable skills</li>\r\n<li>Organize teams to clean up local parks and highways</li>\r\n<li>Develop neighborhood safety projects&nbsp;</li>\r\n</ul>\r\n<h4>&nbsp;</h4>\r\n<h4>Program Goals -&nbsp;All RCCs share four major goals:</h4>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>To encourage individuals to take responsibility for the improvement of their village, neighborhood, or community</li>\r\n<li>To recognize the dignity and value of all useful occupations</li>\r\n<li>To mobilize self-help activities and collective work to improve the quality of life</li>\r\n<li>To encourage the development of human potential to its fullest, within the context of the local culture and community</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 1, 3, 'deepak_acharya.jpg', 'Deepak Acharya, Rotary Community Corps, dhunga sanghu - pokhara, President ,RI Year 2014/15', NULL, NULL, NULL, NULL, NULL, 25, 25, NULL, NULL, NULL, NULL, NULL, '2015-09-04 00:17:01', '2015-09-05 10:49:35'),
	(194, 46, 'Interact Club of Prativa Pokhara Fishtail', NULL, 'interact-club-of-prativa-pokhara-fishtail', '<p>Interect Club of Prativa Pokkhara Fishtail was Chartered on 14 December 2012, as an independent organizatio in Prativa Heigher Seconday School, Pokhara. This club is sponsored by the Rotary Club of Pokhara Fishtail as its one of the Service Partners. The club consist of 12 to 18 years age group student both boys and girls from a single School. The charter-president of the club is Mina Pun Magar. The club holds its regular club meeting on Friday at 2 PM every fortnight at the school premises except examination time and holidayas.</p>\r\n<p>The club mainly focuses on the following parts:</p>\r\n<ul>\r\n<li>Developing leadership skills and personal integrity.</li>\r\n<li>Demonstrating helpfulness and respect for others.</li>\r\n<li>Understanding the value of individual responsibility and hardwork.</li>\r\n<li>Advancing international understanding and goodwill.</li>\r\n</ul>', 1, 2, 'mina_pun_magar.jpg', 'Intr. Mina Pun Magar Interact Club of Prativa Pokhara Fishtail, President RI Year 2014/15', NULL, NULL, NULL, NULL, NULL, 25, 25, NULL, NULL, NULL, NULL, NULL, '2015-09-04 09:16:05', '2015-09-05 10:36:41'),
	(195, 46, 'Rotaract Club of Pokhara Fishtail', NULL, 'rotaract-club-of-pokhara-fishtail', '<p>Rotaract Club of Pokhara Fishtail is a chartered social female youth initiated non profit making international organisation aged 18-30 in corporated under the Rotary Club of Pokhara Fishtail.The club was chartered in 29th June 2007.Since its very inception,the club has been enthusiatically and continuously involved in various genuine activities that are highly fruitful to the soceity. The "3 H " health, hunger , humanity along with different awareness camp, personality development of club members that best serves the purpose of the club has always been the priority. Besides social service and volunteering projects intellectual development is also one of the Rotary club\'s objectives and the rotaractors are partner in service in this major focus areas.</p>\r\n<p>The height of social stigma being a pre dominant factor is surging in absence of awareness and participation and rotaract club of pokhara fishtail being a youth club makes an different attempt to shed a light in how societal dynamics can bring a structural as well as functional changes in society.</p>\r\n<p>Rotaract was founded to develop effective leaders and promote responsible citizenship. As our generation plays a growing role in directing the affairs of this community, it is important that our members be well-positioned to accept the challenge of helping Fishtail reach its potential of becoming a world-class city. We believe for those who are led to think boldly and affect real change, Rotaract provides the premier leadership development and opportunity.</p>', 1, 1, 'chadani_grg.jpg', 'Rtr. Chadani Gurung Rotaract Club of Pokhara Fishtail, President RI Year 2014/15', NULL, NULL, NULL, NULL, NULL, 25, 25, NULL, NULL, NULL, NULL, NULL, '2015-09-04 09:17:01', '2015-09-05 09:44:04'),
	(196, 47, 'Scholorship', NULL, 'scholorship', '<p>.</p>', 1, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 25, 25, NULL, NULL, NULL, NULL, NULL, '2015-09-04 19:58:48', '2015-09-05 18:57:15'),
	(197, 47, 'Micro Lan Scheme', NULL, 'micro-loan-scheme', '<h5><em>"Micro Loans enable the poor to life themselves out of poverty through enterpreneurship."</em></h5>\r\n<p>&nbsp;</p>\r\n<p>The Micro Loan Scheme(MIS) is an effective strategy for extending financial servivice to the poor and disadvantages groups not reached by formal financial sector. Rotary club of Pokhara Fishtail proud to launch Micro Loan with the help of Rotary District-1040 of UK. The mission of Micro Loan is to contribute towards the efforts of poverty alleviation through the sustain ability with improve livelihood of urban poor by providing loan without interest to start new small business or upgrade existing one. The club has been operating the program since 2012 by establishing a revolving fund of NRs. 300,000. By now, more than 25 people have received the loan without interest ranging from 10,000 to 20,000 rupees. Micro loan Scheme is one of the best projects initiates by the club with direct involvement of Rotarians in selection, implementation and monitoring.</p>\r\n<p>&nbsp;</p>\r\n<p>In initiation with the RC Pokhara Fishtail, RC Baglung and RC Lamjung has also started and run the Micro Loan Scheme in their respective districts.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="/cel/2015/aug/projects/rotaryfishtail/new/article/uploads/tinyMCE/main/Chrysanthemum.jpg">For more details, click here to download Brochure</a></p>', 1, 1, 'micro_loan.png', 'What is a Micro Loan? The Procvision of a small loan for those who are too poor to have access to co', NULL, NULL, NULL, NULL, NULL, 25, 25, NULL, NULL, NULL, NULL, NULL, '2015-09-04 19:59:32', '2015-09-05 18:57:19'),
	(198, 4, 'club past projects', NULL, 'club-past-projects', '<h2>Service Projects completed and handed over in 2013</h2>\r\n<p>&nbsp;</p>\r\n<h3>1. WATER SUPPLY PROJECT AT SAHARA ACADEMY</h3>\r\n<ul>\r\n<ul>\r\n<li><strong>Objectives:</strong> To assure adequate water supply for students/trainees and staff of Sahara Academy.</li>\r\n<li><strong>Partner club:</strong> Rotary Club of Cookham Bridge, UK</li>\r\n<li><strong>Status:</strong> Handed over in February 2013</li>\r\n<li><strong>Budget:</strong> NRs. 2,100,000</li>\r\n<li><strong>Committee:</strong>Tej Gurung (Coordinator) , Members: Binod Koirala, Narendra Limbu, (Er) Suresh Prasad Shrestha</li>\r\n</ul>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h3>2. WATER SUPPLY TO MAJHKOT VILLAGE AND SIVALAYA SECONDARY SCHOOL OF THUMKI</h3>\r\n<ul>\r\n<ul>\r\n<li><strong>Objectives:</strong> To assure adequate water supply and improve Sanitation condition at Sivalaya Secondary School and Majhkot village of Thumki VDC, Kaski.</li>\r\n<li><strong>Partner club:</strong> Rotary Club of Bingley Airedale, UK</li>\r\n<li><strong>Status:</strong> Completed and handed over to the community on 28 February 2013</li>\r\n<li><strong>Budget:</strong> Rs. 1,400,000</li>\r\n<li><strong>Committee:</strong>Binod Koirala (Coordinator) , MembersNarendra Limbu, Suresh Prasad Shrestha and Jayendra Gauchan</li>\r\n</ul>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h3>3. WATER SUPPLY TO DHRUBA HIGHER SECONDARY SCHOOL, TARKANG, KASKI</h3>\r\n<ul>\r\n<li><strong>Objectives:</strong> adequate drinking water to students and teachers of the school and improve sanitation condition</li>\r\n<li><strong>Partner club:</strong> RC Grovedale, Australia</li>\r\n<li><strong>Status:</strong> the project and handed over the School Management Committee on 5th May 2013.</li>\r\n<li><strong>Budget:</strong> NRs. 300,000 with additional contribution from locals</li>\r\n<li><strong>Committee:</strong> Binod Koirala (Coordinator), Members: Bishnuhari Timillsina, Narendra Limbu and Jayendra Gauchan</li>\r\n</ul>\r\n<p><br /><br /></p>\r\n<h2>Milestone Projects carried out by the club.</h2>\r\n<p>Since the time of establishment it has contributed in the field of health, education, environment &amp; humanity. Some key important achievements among them were.<br /><br /></p>\r\n<ul>\r\n<ul>\r\n<li>1) Toilet and Drinking water project completed in Janata Primary school, Armala kaski with partner club RC Maing of Germany NRs. 1,75000 (2004/05)</li>\r\n</ul>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li>2) Bir Primary School of Ritthepani, Lekhnath Kaski Toilet Programme NRS 2,25000/- Partner Club Rc South borough and Penburg U.K.</li>\r\n</ul>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li>3) Srijana Drinking Water Project : The project was completed 2009/10 at Pokhara-17. Total Cost : NRS 18 Lakhs partner club RC Breukelum Vechtstreet, Netherland.</li>\r\n</ul>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li>4) Wheel Chair Distributing: 100 wheelchair were distributed to disable people in different areas of Pokhara, Syangja, Waling, Myagdi Tanahun, Lamjung and many other places by matching grants project (2011/12).</li>\r\n</ul>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li>5) Ambulance handed over to Nepal Red Cross Society, Kaski, Chapter on Sept. 2011 Partner Club - RC Surrey B.C. Canada &amp; RC Grovedale Australia by matching grants project.</li>\r\n</ul>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li>6) Kolma Drinking Water Supply Project : Project handed over to community on 3rd Dec 2011, Total cost NRs.11 Lakhs Partner Club - Rotary Club Bristol U.K.</li>\r\n</ul>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li>7) Sahara Drinking Water Project : Project under construction at Pokhara-17 for Sahara Academy- orphan children. Amount NRS 2216000.-partner club RC Kookham Bridge UK</li>\r\n</ul>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<ul>\r\n<li>8) Majhkot Shivalaya Thumki water supply project on going implementing partner club- Rotary Club of Bingley Airdale U.K. Project Cost : NRs.13 Lakhs by matching grants project</li>\r\n</ul>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>9) Prolapse Surgery Project : With the initiation of the club and collaboration of Nepal Government (WRHD) conducted prolapse uterus surgery camp in remote rural area of western region at Bhimad Primary Health Center. In this camp 156 women directly benefited with prolapse surgery.</li>\r\n</ul>\r\n<p>&nbsp;</p>', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 25, 25, NULL, NULL, NULL, NULL, NULL, '2015-09-04 20:13:23', '2015-09-04 17:38:41'),
